import React from 'react';
import PortfolioSummary from './components/PortfolioSummary';
import AIChatInput from './components/AIChatInput';
import MarketDataCards from './components/MarketDataCards';
import NewsTopHoldings from './components/NewsTopHoldings';
import QuickTradeForm from './components/QuickTradeForm';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <h1 className="text-3xl font-bold mb-6">VirtualTradeX Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="md:col-span-2 space-y-6">
          <PortfolioSummary />
          <MarketDataCards />
          <NewsTopHoldings />
        </div>
        <div className="space-y-6">
          <AIChatInput />
          <QuickTradeForm />
        </div>
      </div>
    </div>
  );
}

export default App;
